import styles from './button.module.scss'

const Button = ({ icon: element, text: string }) => {
  return (
    <div className={styles.containerButton}>
      <button className={styles.button}>
        {icon && <div>{icon}</div>}
        {text && <div>{text}</div>}
      </button>
    </div>
  )
}

export default Button
